import React from "react";
import Select from "react-select";
export default function Cards(props) {
  const { name, img, price, discount, stdDel, expDel } = props;
  return (
    <>
      <div className="col-3">
        <div class="card mt-5 text-center">
          <img src={`${img}`} class="card-img-top" />
          <div class="card-body">
            <h5 class="card-title">{name}</h5>
            <p className="banner"> discount: {discount} </p>
            <Select /> 
            <p class="card-text">
              <span className="price">price: Rs {price} /-</span> <br />
              delivery :<i class="fa fa-truck" aria-hidden="true"></i> {stdDel} <br />
              Express delivery: <i class="fa fa-motorcycle" aria-hidden="true"></i> {expDel}
            </p>
            <button href="#" class="bn">
              <i class="fa fa-cart-plus" aria-hidden="true"></i> Add to cart
            </button>
          </div>
        </div>
      </div>
    </>
  );
}
